import React from 'react'; 
import { NavLink } from 'react-router-dom';
// import web from './Images/1.svg';
import Common from './Comon';


const Home = () =>{
    return (
        <>
         <Common 
        name="Welcome to About page"
        imgsrc=""
        visit="/contact"
        btnName="Contact Now"
         />
        </>
    )
}


export default Home;
